import React, { Component } from 'react';
import { Form,Media,Navbar,NavbarBrand,Button,label} from 'reactstrap';

class LeftComponent extends Component {
    constructor (props) {
        super(props)

        this.state = {  
        }

    }




    render() {
        const list = this.props.network.map((provider) =>{
            return(
                <div key={provider.id} className="col-15 mt-3">
                     <Media className="panel panel-default">
                         <Media className="col-10">{provider.name}  </Media>
                         <Media className="col-10">  &#x20B9; {provider.price}</Media>
                     </Media>

                </div>
            );

        }); 



        return (
            <div>
                <div className="container">
                    <div className="row">
                        <Media list>
                            {list}
                        </Media>
                    </div>

                    <form>
                    <div className="container">
                    <h3> 
                        <span className="badge badge-secondary">Sort By</span>

                        <span className="badge badge-secondary">
                            <div className="radio">
                            <label>
                                <input type="radio" value="Price" name="option" />
                                Price
                            </label>
                            <label>
                                <input type="radio" value="Rating" name="option"/>
                                Rating 
                            </label>
                            </div>
                        </span>
                    </h3>
                    </div>
                </form>


                </div>
                

                <table className="table">
                    <thead>
                        <tr>
                            <th>Home     <input type="text" placeholder="Search.."></input> </th>
                        </tr>
                    </thead>
                    <tfoot>
                        <tr>
                            <td>{list}</td>
                        </tr>
                    </tfoot>
                    <tfoot>
                        <tr>
                            <td>logo  Airtel............ Rs 200</td>
                        </tr>
                    </tfoot>
                </table>


                


            </div>
        );
    }
}

export default LeftComponent;
